ButtonComponent displays a button, natch.

@example
const buttonComponent = new ButtonComponent(undefined, {
	text: 'Click me'
})

// Read and set the text
buttonComponent.text // 'Click me'
buttonComponent.text = 'Do it'
buttonComponent.text // 'Do it'

